import "../styles.css"
import background from "../images/supermarket-banner-concept-with-ingredients.jpg"

export default function MainHomePage(){
    return(
        <>
            <div>
                <div style={{
                    backgroundImage: `url(${background})`,
                    height: '620px',
                    width:"auto",
                    backgroundSize: 'contain',
                    backgroundRepeat: 'no-repeat',
                    }}>
                </div>
<input/>
            </div>
        </>
    )
};
